const Todo = ({todo, handleToggle, handleFilter}) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  };

  return (
      <div  id={todo.id} onClick={handleClick} className={todo.complete ? "todo strike" : "todo"}>
        {todo.task} <button onClick={handleFilter}>Clear completed</button>
      </div>
  );
};

export default Todo;
